  const togglepara=useCallback(()=>{
    setpara(showpara=>!showpara);
  },[]);

  return (
    <div className="aap"> 
    <h1></h1>
     {para && (<p>I am para</p>)}
     <Button onClick={togglepara} >Click Me</Button>
    </div>
  );
}
 export default App;
